import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from './pages/Login';
import Register from './pages/Register';
import Right from './pages/Right';

function App() {
  return (


      <header className="flex items-center justify-between">
        <nav className="flex items-center gap-8 text-primary font-semibold">
          <Link className="font-semibold text-2xl text-primary" to="/">
            BREWTIFUL
          </Link>
          <Link to="/">Home</Link>
          <Link to="/menu">Menu</Link>
          <Link to="/about">About</Link>
        </nav>
        <nav className="flex items-center gap-4 text-primary font-semibold">
          <Link to="./pages/Login.js">Login</Link>
          <Link to="./pages/Register" className="bg-primary rounded text-white px-8 py-2">
            Register
          </Link>
          <Link to="./pages/Profile">Profile</Link>
        </nav>
      </header>

  );
}

export default App;
